import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

// KORUYUCULAR
// Dosya yollarının projenize uygun olduğundan emin olun.
import ProtectedRoute from './ProtectedRoute'; 
import AdminProtectedRoute from './AdminProtectedRoute'; 

// GENEL SAYFALAR
import LoginPage from './LoginPage';
import ForgotPasswordPage from './ForgotPasswordPage';

// ===> YENİ KULLANICI SAYFALARINI İMPORT EDİYORUZ <===
import UserDashboard from './UserDashboard';
import MyVehiclesPage from './MyVehiclesPage';

// ===> YÖNETİCİ SAYFALARINI İMPORT EDİYORUZ <===
import AdminDashboard from './AdminDashboard'; 
// Not: Eski VehiclesPage, PersonnelPage gibi sayfalar artık Admin paneline ait olacak.
import VehiclesPage from './VehiclesPage'; // Admin'in tüm araçları yönettiği sayfa
import PersonnelPage from './PersonnelPage'; // Admin'in personeli yönettiği sayfa
// Diğer sayfalarınız...
import CreditCalculatorPage from './CreditCalculatorPage';
import MarketValuePage from './MarketValuePage';

function App() {
  return (
    <Router>
      <Routes>
        {/* ======================================= */}
        {/*      HERKESE AÇIK ROTALAR               */}
        {/* ======================================= */}
        <Route path="/" element={<LoginPage />} />
        <Route path="/forgot-password" element={<ForgotPasswordPage />} />


        {/* ======================================= */}
        {/*      NORMAL KULLANICIYA ÖZEL ROTALAR    */}
        {/* ======================================= */}
        {/* Bu rotalar ProtectedRoute ile korunuyor. */}
        <Route 
          path="/user-dashboard" 
          element={<ProtectedRoute><UserDashboard /></ProtectedRoute>} 
        />
        <Route 
          path="/my-vehicles" 
          element={<ProtectedRoute><MyVehiclesPage /></ProtectedRoute>} 
        />


        {/* ======================================= */}
        {/*      YÖNETİCİYE ÖZEL ROTALAR            */}
        {/* ======================================= */}
        {/* Bu rotalar AdminProtectedRoute ile korunuyor. SADECE rolü 'admin' olanlar erişebilir. */}
        <Route 
          path="/admin-dashboard" 
          element={<AdminProtectedRoute><AdminDashboard /></AdminProtectedRoute>} 
        />
        <Route 
          path="/admin/vehicles" // Admin'in araç yönetim sayfası
          element={<AdminProtectedRoute><VehiclesPage /></AdminProtectedRoute>} 
        />
        <Route 
          path="/admin/personnel" // Admin'in personel yönetim sayfası
          element={<AdminProtectedRoute><PersonnelPage /></AdminProtectedRoute>} 
        />

        {/* Kredi ve Piyasa gibi sayfaların kime ait olduğuna siz karar verebilirsiniz. */}
        {/* Örnek olarak onları da admin paneline taşıyalım: */}
        <Route 
          path="/admin/kredi"
          element={<AdminProtectedRoute><CreditCalculatorPage /></AdminProtectedRoute>} 
        />
        <Route 
          path="/admin/piyasa" 
          element={<AdminProtectedRoute><MarketValuePage /></AdminProtectedRoute>} 
        />

      </Routes>
    </Router>
  );
}

export default App;
